import React from 'react';
import Grid from '@material-ui/core/Grid';

function ControlPanel() {

    return(
        <Grid 
        container 
        spacing={0}
        direction="column"
        justify="center"
        align-items="stretch"
        style={{height: "100%"}}
        >
            <Grid item xs={12} style={{backgroundColor:"#cfe8fc", height: "75%"}}>
            </Grid>
            <Grid item xs={12} style={{backgroundColor:"#ffe8fc", height: "25%"}}>
            </Grid>
            <Grid item xs={12} style={{backgroundColor:"#afe8fc", height: "25%"}}>
            </Grid>
        </Grid>
    );
}

export default ControlPanel;
